Starring: Jolene, Lori, Natalie, Teresa, Jennefer, Jamie Gillis, Ed Powers, Cherri Blossom, Sylar

Number 41 features Teresa, that lovely from Europe you last had seen a glimpse of in #40. This time she gets a bit bold and allows Ed to get between her cheeks, so to speak. Remember Deep Inside #6, featuring Natalie? Well, she promised if she ever decided to go further and be with other men that Ed would be first, and here it is.

She's only been with one other man before. Lovelies Lori and Jennifer help to make Ed happy and put a smile on his face. Lori's first backdoor experience could put a smile on anyone's face. The Bros. Reunite, Jamie and Ed get behind the exotic Cherry Blossom. Originally from Japan, she's a dynamic individual with a lot of sexuality. Ed and Jamie waste no time exploring that. So, join Jamie Gillis and your Bro, Ed Powers in More Dirty Debutantes #41. It's a Dandy! Love Ed
